import { Link } from "react-router-dom";
import { useContext, useEffect } from "react";
import { AuthContext } from "../contexts/AuthContext";
import { useNavigate } from "react-router";

const NavBar = () => {
  const navigate = useNavigate();
  const userLog = useContext(AuthContext);
  const { toggleAuth, isLoggedIn, isAuthenticated } = userLog;

  const handleLogOut = (e) => {
    e.preventDefault();

    toggleAuth(null);
    alert("Goodbye, see you next time ü¶•");
    navigate("/");
  };
  //console.log("isLoggedIn-->", isLoggedIn.user);

  return (
    <div>
      <nav class="navbar navbar-dark bg-dark">
        <Link to="/">
          <a class="navbar-brand">TMDB üéûÔ∏è </a>
        </Link>

        <ul class="nav justify-content-end">
          <li class="nav-item">
            <a class="nav-link">Search your movie</a>
          </li>

          <li class="nav-item">
            <input type="text" placeholder="search your movie"/>
          </li>

          <Link to="/login">
            <li class="nav-item">
              <a class="nav-link active">Log In</a>
            </li>
          </Link>

          <Link to="/">
            <li class="nav-item">
              <a onClick={handleLogOut} class="nav-link" href="#">
                Log Out
              </a>
            </li>
          </Link>

          <Link to="/register">
            <li class="nav-item">
              <a class="nav-link">Sign Up</a>
            </li>
          </Link>
        </ul>
      </nav>
    </div>
  );
};

export default NavBar;
